using OracleReportsWebReference;\n\npublic partial class OracleReportsPage : System.Web.UI.Page\n{\n    protected void Page_Load(object sender, EventArgs e)\n    {\n        // Create a new instance of the Oracle Reports Web Service\n        OracleReportsService reportsService = new OracleReportsService();\n\n        // Set the authentication credentials\n        reportsService.Credentials = new NetworkCredential("your_username", "your_password");\n\n        // Run the Oracle Report\n        byte[] reportBytes = reportsService.runReport("your_report_name", "your_report_server", new Parameter[] { \n            new Parameter("param1", "value1"), \n            new Parameter("param2", "value2") \n        });\n\n        // Display the Oracle Report\n        Response.ContentType = "application/pdf";\n        Response.OutputStream.Write(reportBytes, 0, reportBytes.Length);\n        Response.End();\n    }\n}